import React, { useState, useRef, useEffect, useCallback } from 'react';
import { initializeApp } from 'firebase/app';
import { getFirestore, doc, setDoc, onSnapshot } from 'firebase/firestore';

const firebaseConfig = {
  apiKey: "AIzaSyA9fsrjhBMB520UGzKgybwuYUlxFTnLy9U",
  authDomain: "fumigaciones-sanisidro.firebaseapp.com",
  projectId: "fumigaciones-sanisidro",
  storageBucket: "fumigaciones-sanisidro.firebasestorage.app",
  messagingSenderId: "324530487571",
  appId: "1:324530487571:web:193b956b8b1de334939ae6"
};

let app, db;
try {
  app = initializeApp(firebaseConfig);
  db = getFirestore(app);
} catch (e) {
  console.log('Firebase init error:', e);
}

const MAP_IMAGE = "data:image/webp;base64,";
const MAP_WIDTH = 1500;
const MAP_HEIGHT = 1059;

const CIRC_NAMES = { 
  1: 'Circunscripcin 1', 2: 'Circunscripcin 2', 3: 'Circunscripcin 3', 4: 'Circunscripcin 4',
  5: 'Circunscripcin 5', 6: 'Circunscripcin 6', 7: 'Circunscripcin 7', 8: 'Circunscripcin 8' 
};

const CIRC_COLORS = {
  1: { fill: '#f4a4c4', fillAlpha: 'rgba(244,164,196,0.5)', stroke: '#d64d8a', dark: '#b43264', name: 'Rosa' },
  2: { fill: '#c8a2c8', fillAlpha: 'rgba(200,162,200,0.5)', stroke: '#9a4d9a', dark: '#782878', name: 'Violeta' },
  3: { fill: '#aec6e8', fillAlpha: 'rgba(174,198,232,0.5)', stroke: '#5b8ac2', dark: '#285096', name: 'Azul' },
  4: { fill: '#fff799', fillAlpha: 'rgba(255,247,153,0.5)', stroke: '#c9b834', dark: '#968200', name: 'Amarillo' },
  5: { fill: '#f8cbad', fillAlpha: 'rgba(248,203,173,0.5)', stroke: '#d4885a', dark: '#b45a28', name: 'Naranja' },
  6: { fill: '#8dc1db', fillAlpha: 'rgba(141,193,219,0.5)', stroke: '#4596c7', dark: '#1e64a0', name: 'Celeste' },
  7: { fill: '#ffffc4', fillAlpha: 'rgba(255,255,196,0.5)', stroke: '#b8b834', dark: '#828200', name: 'Amarillo claro' },
  8: { fill: '#a9d1a9', fillAlpha: 'rgba(169,209,169,0.5)', stroke: '#5a9a5a', dark: '#287828', name: 'Verde' },
};

const MONTHS = ['Enero','Febrero','Marzo','Abril','Mayo','Junio','Julio','Agosto','Septiembre','Octubre','Noviembre','Diciembre'];

const SECTION_LIST = {
  1: ['1A', '1B'],
  2: ['2', '2A', '2B', '2C'],
  3: ['3A', '3B', '3C', '3D', '3E', '3F', '3G', '3H', '3J', '3K'],
  4: ['4', '4A', '4B', '4C', '4D', '4E'],
  5: ['5', '5A', '5B', '5C', '5D', '5E', '5F', '5G'],
  6: ['6', '6A', '6B', '6C', '6D', '6E', '6F', '6G', '6H', '6I', '6J'],
  7: ['7', '7A', '7B', '7C', '7D', '7E', '7F', '7G', '7H'],
  8: ['8A', '8B', '8C', '8D', '8E'],
};

export default function FumigacionesEditor() {
  const [sections, setSections] = useState({});
  const [fumigaciones, setFumigaciones] = useState({});
  const [editMode, setEditMode] = useState(false);
  const [currentSection, setCurrentSection] = useState(null);
  const [currentPoints, setCurrentPoints] = useState([]);
  const [currentCirc, setCurrentCirc] = useState(1);
  const [selectedSection, setSelectedSection] = useState(null);
  const [newDate, setNewDate] = useState('');
  const [newNotes, setNewNotes] = useState('');
  const [hoveredSection, setHoveredSection] = useState(null);
  const [viewMonth, setViewMonth] = useState(() => { 
    const n = new Date(); 
    return `${n.getFullYear()}-${String(n.getMonth()+1).padStart(2,'0')}`; 
  });
  const [zoomLevel, setZoomLevel] = useState(1);
  const [panOffset, setPanOffset] = useState({ x: 0, y: 0 });
  const [isPanning, setIsPanning] = useState(false);
  const [panStart, setPanStart] = useState({ x: 0, y: 0 });
  const [showOverlay, setShowOverlay] = useState(true);
  const [saveStatus, setSaveStatus] = useState('');
  const [isOnline, setIsOnline] = useState(true);

  // Estados para puntos especficos
  const [mapPoints, setMapPoints] = useState({});
  const [selectedPoint, setSelectedPoint] = useState(null);
  const [addPointMode, setAddPointMode] = useState(false);
  const [newPointName, setNewPointName] = useState('');
  const [newPointCirc, setNewPointCirc] = useState(1);
  const [hoveredPoint, setHoveredPoint] = useState(null);

  const svgRef = useRef(null);
  const containerRef = useRef(null);
  const saveTimeoutRef = useRef(null);

  useEffect(() => {
    if (!db) {
      setIsOnline(false);
      const savedSections = localStorage.getItem('fumigaciones-sections');
      const savedFumigaciones = localStorage.getItem('fumigaciones-data');
      if (savedSections) setSections(JSON.parse(savedSections));
      if (savedFumigaciones) setFumigaciones(JSON.parse(savedFumigaciones));
      const savedMapPoints = localStorage.getItem('fumigaciones-mappoints');
      if (savedMapPoints) setMapPoints(JSON.parse(savedMapPoints));
      return;
    }

    const unsubSections = onSnapshot(doc(db, 'config', 'sections'), (docSnap) => {
      if (docSnap.exists()) {
        setSections(docSnap.data().data || {});
        setSaveStatus(' Sync');
        setTimeout(() => setSaveStatus(''), 2000);
      }
    }, (error) => {
      console.error('Error:', error);
      setIsOnline(false);
    });

    const unsubFumigaciones = onSnapshot(doc(db, 'config', 'fumigaciones'), (docSnap) => {
      if (docSnap.exists()) setFumigaciones(docSnap.data().data || {});
    });

    const unsubMapPoints = onSnapshot(doc(db, 'config', 'mappoints'), (docSnap) => {
      if (docSnap.exists()) setMapPoints(docSnap.data().data || {});
    });

    return () => { unsubSections(); unsubFumigaciones(); unsubMapPoints(); };
  }, []);

  const saveSections = useCallback(async (newSections) => {
    setSections(newSections);
    localStorage.setItem('fumigaciones-sections', JSON.stringify(newSections));
    if (!db) return;
    setSaveStatus('Guardando...');
    if (saveTimeoutRef.current) clearTimeout(saveTimeoutRef.current);
    saveTimeoutRef.current = setTimeout(async () => {
      try {
        await setDoc(doc(db, 'config', 'sections'), { data: newSections, updatedAt: new Date().toISOString() });
        setSaveStatus(' Guardado');
        setTimeout(() => setSaveStatus(''), 2000);
      } catch (e) { setSaveStatus(' Error'); }
    }, 500);
  }, []);

  const saveFumigaciones = useCallback(async (newFumigaciones) => {
    setFumigaciones(newFumigaciones);
    localStorage.setItem('fumigaciones-data', JSON.stringify(newFumigaciones));
    if (!db) return;
    setSaveStatus('Guardando...');
    if (saveTimeoutRef.current) clearTimeout(saveTimeoutRef.current);
    saveTimeoutRef.current = setTimeout(async () => {
      try {
        await setDoc(doc(db, 'config', 'fumigaciones'), { data: newFumigaciones, updatedAt: new Date().toISOString() });
        setSaveStatus(' Guardado');
        setTimeout(() => setSaveStatus(''), 2000);
      } catch (e) { setSaveStatus(' Error'); }
    }, 500);
  }, []);

  

  const saveMapPoints = useCallback(async (newMapPoints) => {
    setMapPoints(newMapPoints);
    localStorage.setItem('fumigaciones-mappoints', JSON.stringify(newMapPoints));
    if (!db) return;
    setSaveStatus('Guardando...');
    if (saveTimeoutRef.current) clearTimeout(saveTimeoutRef.current);
    saveTimeoutRef.current = setTimeout(async () => {
      try {
        await setDoc(doc(db, 'config', 'mappoints'), { data: newMapPoints, updatedAt: new Date().toISOString() });
        setSaveStatus(' Guardado');
        setTimeout(() => setSaveStatus(''), 2000);
      } catch (e) { setSaveStatus(' Error'); }
    }, 500);
  }, []);

  const currentMonth = (() => { const n = new Date(); return `${n.getFullYear()}-${String(n.getMonth()+1).padStart(2,'0')}`; })();
  const isFumigatedInMonth = (sid, m) => (fumigaciones[sid]||[]).some(f => f.date.startsWith(m));
  
  // CORREGIDO: Calcular coordenadas considerando zoom y pan
  const getMouseCoords = (e) => {
    if (!svgRef.current) return null;
    const svg = svgRef.current;
    const point = svg.createSVGPoint();
    point.x = e.clientX;
    point.y = e.clientY;
    const ctm = svg.getScreenCTM();
    if (!ctm) return null;
    const svgPoint = point.matrixTransform(ctm.inverse());
    return { x: Math.round(svgPoint.x), y: Math.round(svgPoint.y) };
  };

  const handleSvgClick = (e) => {
    // Modo agregar punto especfico
    if (addPointMode && newPointName.trim()) {
      if (e.altKey || isPanning) return;
      e.stopPropagation();
      const coords = getMouseCoords(e);
      if (coords && coords.x >= 0 && coords.x <= MAP_WIDTH && coords.y >= 0 && coords.y <= MAP_HEIGHT) {
        const pointId = `point_${Date.now()}`;
        saveMapPoints({ ...mapPoints, [pointId]: { x: coords.x, y: coords.y, name: newPointName.trim(), circ: newPointCirc } });
        setNewPointName('');
        setAddPointMode(false);
      }
      return;
    }
    if (!editMode || !currentSection) return;
    if (e.altKey || isPanning) return;
    e.stopPropagation();
    const coords = getMouseCoords(e);
    if (coords && coords.x >= 0 && coords.x <= MAP_WIDTH && coords.y >= 0 && coords.y <= MAP_HEIGHT) {
      setCurrentPoints(prev => [...prev, coords]);
    }
  };

  const finishPolygon = () => {
    if (currentPoints.length < 3) { alert('Mnimo 3 puntos'); return; }
    const pointsStr = currentPoints.map(p => `${p.x},${p.y}`).join(' ');
    const cx = Math.round(currentPoints.reduce((s, p) => s + p.x, 0) / currentPoints.length);
    const cy = Math.round(currentPoints.reduce((s, p) => s + p.y, 0) / currentPoints.length);
    saveSections({ ...sections, [currentSection]: { circ: currentCirc, points: pointsStr, center: { x: cx, y: cy } } });
    setCurrentPoints([]);
    setCurrentSection(null);
  };

  const cancelPolygon = () => { setCurrentPoints([]); setCurrentSection(null); };
  const deleteSection = (id) => { if (confirm(`Eliminar ${id}?`)) { const n = { ...sections }; delete n[id]; saveSections(n); } };
  const undoLastPoint = () => { setCurrentPoints(prev => prev.slice(0, -1)); };

  const addFumigacion = () => {
    if (!selectedSection || !newDate) return;
    saveFumigaciones({
      ...fumigaciones,
      [selectedSection]: [...(fumigaciones[selectedSection]||[]), { date: newDate, notes: newNotes, timestamp: Date.now() }].sort((a,b) => new Date(b.date)-new Date(a.date))
    });
    setNewDate(''); setNewNotes('');
  };

  const deleteFumigacion = (sid, ts) => {
    saveFumigaciones({ ...fumigaciones, [sid]: (fumigaciones[sid]||[]).filter(f => f.timestamp !== ts) });
  };

  const markAllInCirc = (circ) => {
    const today = new Date().toISOString().split('T')[0];
    const toMark = Object.entries(sections).filter(([id, d]) => d.circ === circ && !isFumigatedInMonth(id, viewMonth)).map(([id]) => id);
    if (toMark.length === 0) return;
    const newFum = { ...fumigaciones };
    toMark.forEach(id => { newFum[id] = [...(fumigaciones[id]||[]), { date: today, notes: `Circ. ${circ}`, timestamp: Date.now() }]; });
    saveFumigaciones(newFum);
  };

  // Funciones para puntos especficos
  const deleteMapPoint = (pointId) => {
    if (confirm(`Eliminar punto "${mapPoints[pointId]?.name}"?`)) {
      const n = { ...mapPoints };
      delete n[pointId];
      saveMapPoints(n);
      const newFum = { ...fumigaciones };
      delete newFum[`point_${pointId}`];
      saveFumigaciones(newFum);
      if (selectedPoint === pointId) setSelectedPoint(null);
    }
  };

  const addPointFumigacion = () => {
    if (!selectedPoint || !newDate) return;
    const fumKey = `point_${selectedPoint}`;
    saveFumigaciones({
      ...fumigaciones,
      [fumKey]: [...(fumigaciones[fumKey]||[]), { date: newDate, notes: newNotes, timestamp: Date.now() }].sort((a,b) => new Date(b.date)-new Date(a.date))
    });
    setNewDate(''); setNewNotes('');
  };

  const deletePointFumigacion = (pointId, ts) => {
    const fumKey = `point_${pointId}`;
    saveFumigaciones({ ...fumigaciones, [fumKey]: (fumigaciones[fumKey]||[]).filter(f => f.timestamp !== ts) });
  };

  const isPointFumigatedInMonth = (pointId, m) => {
    const fumKey = `point_${pointId}`;
    return (fumigaciones[fumKey]||[]).some(f => f.date.startsWith(m));
  };


  const formatDate = (s) => { const [y,m,d] = s.split('-'); return `${d}/${m}/${y}`; };
  const parseViewMonth = () => { const [y,m] = viewMonth.split('-'); return `${MONTHS[parseInt(m)-1]} ${y}`; };

  const handleWheel = (e) => { e.preventDefault(); setZoomLevel(p => Math.min(Math.max(0.3, p + (e.deltaY > 0 ? -0.1 : 0.1)), 5)); };
  const handleMouseDown = (e) => { if (e.button === 1 || (e.button === 0 && e.altKey)) { e.preventDefault(); setIsPanning(true); setPanStart({ x: e.clientX - panOffset.x, y: e.clientY - panOffset.y }); } };
  const handleMouseMove = (e) => { if (isPanning) setPanOffset({ x: e.clientX - panStart.x, y: e.clientY - panStart.y }); };
  const handleMouseUp = () => setIsPanning(false);
  const resetView = () => { setZoomLevel(1); setPanOffset({ x: 0, y: 0 }); };

  const fumigatedCount = Object.keys(sections).filter(id => isFumigatedInMonth(id, viewMonth)).length;
  const totalSections = Object.keys(sections).length;
  const pendingCount = totalSections - fumigatedCount;
  const drawColor = CIRC_COLORS[currentCirc];

  return (
    <div className="min-h-screen bg-slate-900 text-white flex flex-col">
      <header className="bg-slate-800 shadow-xl p-3 z-50 border-b border-slate-700">
        <div className="flex flex-wrap items-center justify-between gap-3">
          <div className="flex items-center gap-3">
            <div className="text-3xl"></div>
            <div>
              <h1 className="text-lg font-bold">Control de Fumigaciones - San Isidro</h1>
              <p className="text-xs text-slate-400">
                {editMode ? ' MODO EDICIN' : `${totalSections} secciones`}
                {saveStatus && <span className="ml-2 text-emerald-400">{saveStatus}</span>}
                {!isOnline && <span className="ml-2 text-amber-400"> Offline</span>}
              </p>
            </div>
          </div>
          
          <div className="flex items-center gap-2">
            {!editMode && totalSections > 0 && (
              <div className="hidden md:flex items-center gap-2">
                <div className="text-center px-2 py-1 bg-emerald-900/40 border border-emerald-700 rounded">
                  <div className="text-lg font-bold text-emerald-400">{fumigatedCount}</div>
                  <div className="text-xs text-emerald-300">Fumigadas</div>
                </div>
                <div className="text-center px-2 py-1 bg-amber-900/40 border border-amber-700 rounded">
                  <div className="text-lg font-bold text-amber-400">{pendingCount}</div>
                  <div className="text-xs text-amber-300">Pendientes</div>
                </div>
              </div>
            )}
            <button onClick={() => setEditMode(!editMode)} className={`px-3 py-1.5 rounded text-sm font-medium ${editMode ? 'bg-red-600 hover:bg-red-500' : 'bg-purple-600 hover:bg-purple-500'}`}>
              {editMode ? ' Salir' : ' Editar'}
            </button>
            {!editMode && <input type="month" value={viewMonth} onChange={(e) => setViewMonth(e.target.value)} className="bg-slate-700 border border-slate-600 rounded px-2 py-1 text-sm outline-none" />}
          </div>
        </div>
        
        <div className="flex flex-wrap items-center gap-2 mt-2 pt-2 border-t border-slate-700">
          <button onClick={() => setShowOverlay(!showOverlay)} className={`px-3 py-1.5 rounded text-sm font-medium ${showOverlay ? 'bg-orange-600' : 'bg-slate-600'}`}> reas</button>
          <button onClick={resetView} className="px-3 py-1.5 bg-slate-600 hover:bg-slate-500 rounded text-sm font-medium"> Reset</button>
          <span className="text-xs text-slate-400 ml-2">Zoom: {Math.round(zoomLevel * 100)}%</span>
          {viewMonth !== currentMonth && !editMode && <span className="text-xs bg-amber-600/80 px-2 py-1 rounded ml-auto"> {parseViewMonth()}</span>}
        </div>
      </header>

      <div className="flex-1 flex overflow-hidden">
        <div 
          ref={containerRef}
          className="flex-1 relative overflow-hidden bg-slate-800" 
          onWheel={handleWheel} 
          onMouseDown={handleMouseDown} 
          onMouseMove={handleMouseMove} 
          onMouseUp={handleMouseUp} 
          onMouseLeave={handleMouseUp} 
          style={{ cursor: isPanning ? 'grabbing' : (editMode && currentSection ? 'crosshair' : 'default') }}
        >
          <svg 
            ref={svgRef}
            viewBox={`0 0 ${MAP_WIDTH} ${MAP_HEIGHT}`} 
            className="w-full h-full" 
            style={{ 
              maxHeight: 'calc(100vh - 120px)',
              transform: `scale(${zoomLevel}) translate(${panOffset.x / zoomLevel}px, ${panOffset.y / zoomLevel}px)`,
              transformOrigin: 'center',
              transition: isPanning ? 'none' : 'transform 0.1s'
            }}
            onClick={handleSvgClick}
          >
            <image href={MAP_IMAGE} x="0" y="0" width={MAP_WIDTH} height={MAP_HEIGHT} />
            
            {showOverlay && Object.entries(sections).map(([id, data]) => {
              const isSelected = selectedSection === id;
              const isHovered = hoveredSection === id;
              const isFumigated = !editMode && isFumigatedInMonth(id, viewMonth);
              const c = CIRC_COLORS[data.circ];
              return (
                <g key={id}>
                  <polygon 
                    points={data.points} 
                    fill={isFumigated ? c.dark : (isHovered || isSelected ? c.fillAlpha : c.fillAlpha.replace('0.5', '0.25'))} 
                    stroke={isSelected ? '#fbbf24' : (isFumigated ? '#22c55e' : c.stroke)} 
                    strokeWidth={isSelected ? 4 : 2} 
                    className="cursor-pointer"
                    onClick={(e) => { e.stopPropagation(); if (!editMode) setSelectedSection(id); }}
                    onMouseEnter={() => setHoveredSection(id)}
                    onMouseLeave={() => setHoveredSection(null)}
                  />
                  <text x={data.center.x} y={data.center.y + 6} textAnchor="middle" fontSize="20" fontWeight="bold" fill={isFumigated ? '#22c55e' : '#fff'} stroke={isFumigated ? 'none' : '#000'} strokeWidth="3" paintOrder="stroke" className="pointer-events-none">{isFumigated ? '' : id}</text>
                </g>
              );
            })}
            
            {editMode && currentPoints.length > 0 && (
              <g>
                <polygon points={currentPoints.map(p => `${p.x},${p.y}`).join(' ')} fill={drawColor.fillAlpha} stroke={drawColor.stroke} strokeWidth="3" strokeDasharray="10,5" />
                {currentPoints.length > 2 && <line x1={currentPoints[currentPoints.length-1].x} y1={currentPoints[currentPoints.length-1].y} x2={currentPoints[0].x} y2={currentPoints[0].y} stroke={drawColor.stroke} strokeWidth="2" strokeDasharray="5,5" opacity="0.7" />}
                {currentPoints.map((p, i) => <circle key={i} cx={p.x} cy={p.y} r="8" fill={i === 0 ? '#22c55e' : drawColor.stroke} stroke="#fff" strokeWidth="2" />)}
              </g>
            )}
            {/* Renderizado de puntos especficos */}
            {showOverlay && Object.entries(mapPoints).map(([pointId, point]) => {
              const isSelected = selectedPoint === pointId;
              const isHovered = hoveredPoint === pointId;
              const isFumigated = !editMode && isPointFumigatedInMonth(pointId, viewMonth);
              const c = CIRC_COLORS[point.circ];
              return (
                <g key={pointId}>
                  <circle
                    cx={point.x}
                    cy={point.y}
                    r={isSelected || isHovered ? 18 : 15}
                    fill={isFumigated ? c.dark : (isHovered || isSelected ? c.fill : c.fillAlpha)}
                    stroke={isSelected ? '#fbbf24' : (isFumigated ? '#22c55e' : c.stroke)}
                    strokeWidth={isSelected ? 4 : 3}
                    className="cursor-pointer transition-all"
                    onClick={(e) => { e.stopPropagation(); if (!editMode) { setSelectedPoint(pointId); setSelectedSection(null); } }}
                    onMouseEnter={() => setHoveredPoint(pointId)}
                    onMouseLeave={() => setHoveredPoint(null)}
                  />
                  <text x={point.x} y={point.y + 5} textAnchor="middle" fontSize="12" fontWeight="bold" fill={isFumigated ? '#22c55e' : '#fff'} stroke={isFumigated ? 'none' : '#000'} strokeWidth="2" paintOrder="stroke" className="pointer-events-none">
                    {isFumigated ? '' : ''}
                  </text>
                </g>
              );
            })}

          </svg>

          {hoveredSection && !editMode && (
            <div className="absolute top-3 left-3 bg-slate-900/95 px-3 py-2 rounded-lg shadow-xl border border-slate-700 text-sm">
              <div className="font-bold">Seccin {hoveredSection}</div>
              <div className="text-slate-400 text-xs">{CIRC_NAMES[sections[hoveredSection]?.circ]}</div>
              {isFumigatedInMonth(hoveredSection, viewMonth) && <div className="text-emerald-400 text-xs mt-1"> Fumigada</div>}
            </div>
          )}
          {hoveredPoint && !editMode && (
            <div className="absolute top-3 left-3 bg-slate-900/95 px-3 py-2 rounded-lg shadow-xl border border-slate-700 text-sm">
              <div className="font-bold"> {mapPoints[hoveredPoint]?.name}</div>
              <div className="text-slate-400 text-xs">{CIRC_NAMES[mapPoints[hoveredPoint]?.circ]}</div>
              {isPointFumigatedInMonth(hoveredPoint, viewMonth) && <div className="text-emerald-400 text-xs mt-1"> Fumigado</div>}
            </div>
          )}


          <div className="absolute bottom-3 right-3 flex flex-col gap-1">
            <button onClick={() => setZoomLevel(p => Math.min(5, p + 0.2))} className="w-10 h-10 bg-slate-800/90 hover:bg-slate-700 rounded text-xl font-bold border border-slate-600">+</button>
            <button onClick={() => setZoomLevel(p => Math.max(0.3, p - 0.2))} className="w-10 h-10 bg-slate-800/90 hover:bg-slate-700 rounded text-xl font-bold border border-slate-600"></button>
          </div>
        </div>

        <div className="w-80 bg-slate-850 border-l border-slate-700 overflow-y-auto" style={{ maxHeight: 'calc(100vh - 120px)' }}>
          <div className="p-3 space-y-3">
            {editMode ? (
              <>
                <div className="bg-slate-800 rounded-xl p-3 border border-slate-700">
                  <h3 className="font-bold mb-3"> Dibujar polgono</h3>
                  {currentSection ? (
                    <div className="space-y-2">
                      <div className="rounded p-2 border-2" style={{ backgroundColor: drawColor.fill, borderColor: drawColor.stroke }}>
                        <div className="font-bold text-slate-900">Dibujando: {currentSection}</div>
                        <div className="text-sm text-slate-800">{currentPoints.length} puntos - Clic en mapa</div>
                      </div>
                      <div className="flex gap-2">
                        <button onClick={finishPolygon} disabled={currentPoints.length < 3} className="flex-1 px-2 py-1.5 bg-emerald-600 hover:bg-emerald-500 disabled:bg-slate-600 disabled:text-slate-400 rounded text-sm font-medium"> Terminar</button>
                        <button onClick={undoLastPoint} disabled={currentPoints.length === 0} className="px-2 py-1.5 bg-amber-600 hover:bg-amber-500 disabled:bg-slate-600 disabled:text-slate-400 rounded text-sm font-medium"></button>
                        <button onClick={cancelPolygon} className="px-2 py-1.5 bg-red-600 hover:bg-red-500 rounded text-sm font-medium"></button>
                      </div>
                    </div>
                  ) : (
                    <div className="space-y-3">
                      <div>
                        <label className="text-xs text-slate-400 block mb-1">Circunscripcin:</label>
                        <div className="grid grid-cols-4 gap-1">
                          {[1,2,3,4,5,6,7,8].map(c => {
                            const col = CIRC_COLORS[c];
                            const isActive = currentCirc === c;
                            return (
                              <button 
                                key={c} 
                                onClick={() => setCurrentCirc(c)} 
                                className="px-2 py-2 rounded text-sm font-bold border-2 transition-all"
                                style={{ 
                                  backgroundColor: isActive ? col.fill : 'transparent',
                                  borderColor: col.stroke,
                                  color: isActive ? '#1e293b' : col.stroke
                                }}
                              >
                                {c}
                              </button>
                            );
                          })}
                        </div>
                      </div>
                      
                      <div className="p-2 rounded border-2" style={{ backgroundColor: CIRC_COLORS[currentCirc].fill, borderColor: CIRC_COLORS[currentCirc].stroke }}>
                        <div className="text-sm font-bold text-slate-900 mb-2">
                          Circ. {currentCirc} - {CIRC_COLORS[currentCirc].name}
                        </div>
                        <div className="flex flex-wrap gap-1">
                          {SECTION_LIST[currentCirc]?.map(id => {
                            const isDone = !!sections[id];
                            const col = CIRC_COLORS[currentCirc];
                            return (
                              <button 
                                key={id} 
                                onClick={() => !isDone && setCurrentSection(id)}
                                disabled={isDone}
                                className="px-2 py-1 rounded text-xs font-bold border transition-all"
                                style={{
                                  backgroundColor: isDone ? col.dark : '#fff',
                                  borderColor: col.stroke,
                                  color: isDone ? '#fff' : col.stroke,
                                  opacity: isDone ? 0.8 : 1,
                                  cursor: isDone ? 'not-allowed' : 'pointer'
                                }}
                              >
                                {id} {isDone ? '' : ''}
                              </button>
                            );
                          })}
                        </div>
                      </div>
                    </div>
                  )}
                </div>
                
                <div className="bg-slate-800 rounded-xl p-3 border border-slate-700">
                  <h3 className="font-bold mb-2 text-sm"> Polgonos ({totalSections})</h3>
                  <div className="max-h-40 overflow-y-auto space-y-1">
                    {Object.entries(sections).sort((a,b) => a[0].localeCompare(b[0])).map(([id, data]) => {
                      const col = CIRC_COLORS[data.circ];
                      return (
                        <div key={id} className="flex justify-between items-center p-1.5 rounded text-sm" style={{ backgroundColor: col.fill }}>
                          <span className="font-medium text-slate-900">{id} <span className="text-xs">(C{data.circ})</span></span>
                          <button onClick={() => deleteSection(id)} className="text-red-600 hover:text-red-800 px-1 font-bold"></button>
                        </div>
                      );
                    })}
                    {totalSections === 0 && <div className="text-slate-500 text-sm text-center py-2">Sin polgonos</div>}
                  </div>
                </div>
                

                <div className="bg-slate-800 rounded-xl p-3 border border-slate-700">
                  <h3 className="font-bold mb-3"> Agregar punto</h3>
                  {addPointMode ? (
                    <div className="space-y-2">
                      <div className="rounded p-2 border-2 border-cyan-500 bg-cyan-900/30">
                        <div className="font-bold text-cyan-300">Modo agregar punto</div>
                        <div className="text-sm text-cyan-200">Clic en el mapa para ubicar</div>
                      </div>
                      <input type="text" value={newPointName} onChange={(e) => setNewPointName(e.target.value)} placeholder="Nombre del punto..." className="w-full bg-slate-700 border border-slate-600 rounded px-2 py-1.5 text-sm" />
                      <div>
                        <label className="text-xs text-slate-400 block mb-1">Circunscripcin:</label>
                        <div className="grid grid-cols-4 gap-1">
                          {[1,2,3,4,5,6,7,8].map(c => {
                            const col = CIRC_COLORS[c];
                            return (
                              <button key={c} onClick={() => setNewPointCirc(c)} className="p-1.5 rounded text-xs font-bold transition-all" style={{ backgroundColor: newPointCirc === c ? col.fill : col.fillAlpha, borderColor: col.stroke, border: '2px solid', color: newPointCirc === c ? '#1e293b' : col.stroke }}>{c}</button>
                            );
                          })}
                        </div>
                      </div>
                      <button onClick={() => { setAddPointMode(false); setNewPointName(''); }} className="w-full py-1.5 bg-red-600 hover:bg-red-500 rounded text-sm font-medium"> Cancelar</button>
                    </div>
                  ) : (
                    <button onClick={() => setAddPointMode(true)} className="w-full py-2 bg-cyan-600 hover:bg-cyan-500 rounded text-sm font-medium">+ Agregar punto especfico</button>
                  )}
                  {Object.keys(mapPoints).length > 0 && (
                    <div className="mt-3 pt-3 border-t border-slate-700">
                      <h4 className="text-xs text-slate-400 mb-2">Puntos ({Object.keys(mapPoints).length}):</h4>
                      <div className="max-h-32 overflow-y-auto space-y-1">
                        {Object.entries(mapPoints).map(([id, point]) => {
                          const col = CIRC_COLORS[point.circ];
                          return (
                            <div key={id} className="flex justify-between items-center p-1.5 rounded text-sm" style={{ backgroundColor: col.fillAlpha }}>
                              <span className="font-medium text-white text-xs"> {point.name}</span>
                              <button onClick={() => deleteMapPoint(id)} className="text-red-400 hover:text-red-300 px-1 font-bold"></button>
                            </div>
                          );
                        })}
                      </div>
                    </div>
                  )}
                </div>
                
                <div className="bg-blue-900/30 border border-blue-600 rounded-xl p-3">
                  <h4 className="font-bold text-blue-300 mb-2 text-sm"> Instrucciones</h4>
                  <ol className="text-xs text-blue-200 space-y-1 list-decimal list-inside">
                    <li>Eleg circunscripcin (color)</li>
                    <li>Clic en seccin a dibujar</li>
                    <li>Clic en mapa = agregar punto</li>
                    <li>"Terminar" guarda online</li>
                  </ol>
                </div>
              </>
            ) : (
              <>
                {selectedSection && sections[selectedSection] ? (
                  <div className="bg-slate-800 rounded-xl p-3 border border-slate-700">
                    <div className="flex justify-between mb-3">
                      <div><h3 className="text-lg font-bold">Seccin {selectedSection}</h3><p className="text-xs text-slate-400">{CIRC_NAMES[sections[selectedSection].circ]}</p></div>
                      <button onClick={() => setSelectedSection(null)} className="text-slate-400 hover:text-white text-xl"></button>
                    </div>
                    {isFumigatedInMonth(selectedSection, viewMonth) ? (
                      <div className="bg-emerald-900/30 border border-emerald-600 rounded p-2 mb-3"><div className="text-emerald-400 text-sm"> Fumigada en {parseViewMonth()}</div></div>
                    ) : (
                      <div className="bg-amber-900/30 border border-amber-600 rounded p-2 mb-3"><div className="text-amber-400 text-sm"> Pendiente</div></div>
                    )}
                    <div className="space-y-2 p-2 bg-slate-700/40 rounded">
                      <input type="date" value={newDate} onChange={(e) => setNewDate(e.target.value)} className="w-full bg-slate-700 border border-slate-600 rounded px-2 py-1.5 text-sm" />
                      <input type="text" value={newNotes} onChange={(e) => setNewNotes(e.target.value)} placeholder="Notas..." className="w-full bg-slate-700 border border-slate-600 rounded px-2 py-1.5 text-sm" />
                      <button onClick={addFumigacion} disabled={!newDate} className="w-full py-2 bg-blue-600 hover:bg-blue-500 disabled:bg-slate-600 rounded text-sm font-medium">+ Registrar</button>
                    </div>
                    {fumigaciones[selectedSection]?.length > 0 && (
                      <div className="mt-3 pt-3 border-t border-slate-700">
                        <h4 className="text-xs text-slate-300 mb-2">Historial:</h4>
                        <div className="max-h-32 overflow-y-auto space-y-1">
                          {fumigaciones[selectedSection].map(f => (
                            <div key={f.timestamp} className="flex justify-between text-xs p-1.5 bg-slate-700/50 rounded">
                              <span>{formatDate(f.date)} {f.notes && `- ${f.notes}`}</span>
                              <button onClick={() => deleteFumigacion(selectedSection, f.timestamp)} className="text-red-400"></button>
                            </div>
                          ))}
                        </div>
                      </div>
                    )}
                  </div>
                ) : selectedPoint && mapPoints[selectedPoint] ? (
                  <div className="bg-slate-800 rounded-xl p-3 border border-slate-700">
                    <div className="flex justify-between mb-3">
                      <div><h3 className="text-lg font-bold"> {mapPoints[selectedPoint].name}</h3><p className="text-xs text-slate-400">{CIRC_NAMES[mapPoints[selectedPoint].circ]}</p></div>
                      <button onClick={() => setSelectedPoint(null)} className="text-slate-400 hover:text-white text-xl"></button>
                    </div>
                    {isPointFumigatedInMonth(selectedPoint, viewMonth) ? (
                      <div className="bg-emerald-900/30 border border-emerald-600 rounded p-2 mb-3"><div className="text-emerald-400 text-sm"> Fumigado en {parseViewMonth()}</div></div>
                    ) : (
                      <div className="bg-amber-900/30 border border-amber-600 rounded p-2 mb-3"><div className="text-amber-400 text-sm"> Pendiente</div></div>
                    )}
                    <div className="space-y-2 p-2 bg-slate-700/40 rounded">
                      <input type="date" value={newDate} onChange={(e) => setNewDate(e.target.value)} className="w-full bg-slate-700 border border-slate-600 rounded px-2 py-1.5 text-sm" />
                      <input type="text" value={newNotes} onChange={(e) => setNewNotes(e.target.value)} placeholder="Notas..." className="w-full bg-slate-700 border border-slate-600 rounded px-2 py-1.5 text-sm" />
                      <button onClick={addPointFumigacion} disabled={!newDate} className="w-full py-2 bg-cyan-600 hover:bg-cyan-500 disabled:bg-slate-600 rounded text-sm font-medium">+ Registrar</button>
                    </div>
                    {fumigaciones[`point_${selectedPoint}`]?.length > 0 && (
                      <div className="mt-3 pt-3 border-t border-slate-700">
                        <h4 className="text-xs text-slate-300 mb-2">Historial:</h4>
                        <div className="max-h-32 overflow-y-auto space-y-1">
                          {fumigaciones[`point_${selectedPoint}`].map(f => (
                            <div key={f.timestamp} className="flex justify-between text-xs p-1.5 bg-slate-700/50 rounded">
                              <span>{formatDate(f.date)} {f.notes && `- ${f.notes}`}</span>
                              <button onClick={() => deletePointFumigacion(selectedPoint, f.timestamp)} className="text-red-400"></button>
                            </div>
                          ))}
                        </div>
                      </div>
                    )}
                  </div>
                ) : (
                  <div className="bg-blue-900/20 border border-blue-700 rounded-xl p-3">
                    <h3 className="font-medium text-blue-300 mb-2"> Uso</h3>
                    <ul className="text-xs text-blue-200 space-y-1">
                      <li> Clic en seccin para seleccionar</li>
                      <li> Scroll = zoom</li>
                      <li> Alt+clic = mover mapa</li>
                    </ul>
                    {totalSections === 0 && <div className="mt-3 p-2 bg-amber-900/30 border border-amber-600 rounded"><div className="text-amber-400 text-xs"> Sin polgonos. Us "Editar" para dibujar.</div></div>}
                  </div>
                )}
                {totalSections > 0 && (
                  <div className="bg-slate-800 rounded-xl p-3 border border-slate-700">
                    <h3 className="text-sm font-bold mb-2"> Por Circunscripcin</h3>
                    {[1,2,3,4,5,6,7,8].map(c => {
                      const secs = Object.entries(sections).filter(([,d]) => d.circ === c);
                      if (secs.length === 0) return null;
                      const fum = secs.filter(([id]) => isFumigatedInMonth(id, viewMonth)).length;
                      const pct = Math.round((fum / secs.length) * 100);
                      const col = CIRC_COLORS[c];
                      return (
                        <div key={c} className="mb-2">
                          <div className="flex justify-between items-center text-xs mb-1">
                            <span style={{ color: col.stroke, fontWeight: 'bold' }}>C{c} {col.name}</span>
                            <div className="flex items-center gap-2">
                              <span>{fum}/{secs.length}</span>
                              {fum < secs.length && <button onClick={() => markAllInCirc(c)} className="text-xs px-1.5 py-0.5 rounded text-white" style={{ backgroundColor: col.dark }}> Todas</button>}
                            </div>
                          </div>
                          <div className="h-2 bg-slate-700 rounded-full overflow-hidden"><div className="h-full transition-all" style={{ width: `${pct}%`, backgroundColor: col.stroke }} /></div>
                        </div>
                      );
                    })}
                  </div>
                )}
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}
